import Register from './Register';
import Login from './Login'
import Layout from './components/Layout'

import { Routes, Route } from 'react-router-dom';
function App() {
  return (
    <Routes>
      <Route path="/" element={<Layout/>}>
        <Route path='login' element={<Login/>}></Route>
      </Route>
    </Routes>
  );
}

export default App;
